import React, { Component } from 'react'
import './App.css';
import Navbars from './Componets/Navbars';
import NewsShow from './Componets/NewsShow';
import {
  BrowserRouter as Router,


} from "react-router-dom";
import DarkMode from './Componets/DarkMode';
export class App extends Component {
  pageSize =5;

  render() {
    return (
      <div>
      <Router>
      <Navbars/>
      <DarkMode/>

          <li exact path="/general"><NewsShow key='home' pageSize={this.pageSize} country='in' category='general' /> </li>
          <li exact path="/business"><NewsShow key="business" pageSize={6} country='in' category='business'/> </li>
          <li exact path="/entertainment"><NewsShow key='entertainment'pageSize={6} country='in' category='entertainment'/> </li>
          <li exact path="/general"><NewsShow key='general'pageSize={6} country='in' category='general'/> </li>
          <li exact path="/health"><NewsShow key='health'pageSize={6} country='in' category='health'/> </li>
          <li exact path="/science"><NewsShow key='science'pageSize={6} country='in' category='science'/> </li>
          <li exact path="/sports"><NewsShow key='sports'pageSize={6} country='in' category='sports'/> </li>
          <li exact path="/technology"><NewsShow key='technology'pageSize={6} country='in' category='technology'/> </li>

      </Router>

      </div>
    )
    }
}

export default App
